INSERT INTO `oc_admin_nav` VALUES (1,0,'home','首页','link','','','fa-archive',1441293186,1441297331,0,1,''),(2,0,'user','用户','module','User','','fa fa-users',1457065442,1457065442,0,1,''),(3,0,'cms','CMS','module','Cms','','fa fa-newspaper-o',1457065452,1457065452,0,1,''),(4,0,'rent','租房','module','Rent','','fa fa-home',1457065462,1457065462,0,1,''),(5,0,'developer','开发工具','module','Developer','','fa fa-coffee',1458288798,1458288798,0,1,''),(7,0,'','关于我们','page','<p class=\"MsoNormal\">\r\n	【公司简介】\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	e乡e家创立于2016年，总部分别设立于中国北京与美国纽约曼哈顿，是一个为海外留学生提供租房以及相关衍生服务的互联网公司，致力于消除海外租房中的信息不对称所导致的高成本租房问题。e乡e家的核心团队背景包括美国名校金融、数学、计算机等，利用前沿技术(VR看房等)与数据优化分析，为留学生提供最贴心最专业的租房体验。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	e乡e家成立至今，覆盖纽约、新泽西区域公寓大楼数量超过200座，已为上千位海外留学生解决了租房问题，租赁公寓数量超过300套，平台交易额突破1千万美元。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	【公司理念】\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	曾经我们一群年轻人来到纽约，租房成了最大的问题，现在我们再次聚集在一起，为了梦想，帮大家租到好房。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"line-height:1.42857;\">e乡e家以提升用户租赁体验为核心原则，在e乡e家，假房源、高中介费等问题将不复存在，你将用最短时间享受最便捷的租住体验。对我们而言，您租到的不仅仅是个居所，而是一个家。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>','','',1458907747,1492067589,0,1,'bottom'),(9,0,'','商务合作','page','<p class=\"MsoNormal\">\r\n	请发邮件至info@ehomie.com并简要描述您的公司、公司产品以及合作方式，我们会尽快与您联系。\r\n</p>','','',1458907942,1492067661,0,1,'bottom'),(10,0,'','媒体合作','page','<p class=\"MsoNormal\">\r\n	请发邮件至kana@ehomie.com并简要描述您的媒体品牌，我们会尽快与您联系。\r\n</p>','','',1458907965,1492067688,0,1,'bottom'),(11,0,'','联系我们','page','<p class=\"MsoNormal\">\r\n	e乡e家随时欢迎您的提问，请通过以下任意一种方式与我们联系。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	邮箱: info@ehomie.com\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	微信: ehomie01\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	电话:&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	美国 +1 212-847-9839 (9:00AM-5:00PM)\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	中国 +86 010-57750377 (上午9点-下午6点)\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	地址:\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	纽约总部: 750 3rd Ave, 9th FL, New York, NY10017\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	北京总部: 北京市朝阳区东三环中路5号财富金融中心26层\r\n</p>','','',1458907983,1492067874,0,1,'bottom'),(12,0,'','加入我们','page','<p class=\"MsoNormal\">\r\n	我们很高兴你对e乡e家表现出兴趣\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	或许有心<span> </span>或许无意\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	但我们相信这将是你不愿错过的一段旅程\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	如果你曾渴望自己拥有一份事业\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	为之拼搏，为自己的梦想，为了帮助他人\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	如果你希望尽情挥洒自己的才华\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	找到一群志同道合的伙伴\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	勇往直前，付出青春和汗水\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	这就是为什么我们创立e乡e家\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	我们带着情怀、激情来到这里\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	我们希望为别人解决问题，为个人赢得成就\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	我们希望能创建受别人尊重的公司\r\n</p>\r\n<p>\r\n	我们需要你的加入！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	请将简历发至邮箱: info@ehomie.com\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span></span> \r\n</p>','','',1458908008,1492067923,0,1,'bottom');
