INSERT INTO `oc_cms_article` VALUES (1,'感谢曾经被孤独选择的时光','','<p>\r\n	大学毕业以后，我就再没和别人合租过。那个时候，独自来到波士顿，住在学校附近的high rise，楼有点老旧，一室一厅，价格却不菲。我一个人把装行李的纸箱子一个一个拆开，整理，收纳，布置，花了整整一周的时间。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	那时，我正经历着一场莫名其妙的感情。一个人从波士顿坐巴士去纽约，又一个人坐巴士回来，去的时候，期待有个好的结局，回来的时候，整个心蒙了一层灰。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	记得那时每到晚上，我便蜷缩在沙发里，周围特别静，窗外不远就是山，星空很美，却美得寂寥。有一天夜里，突然传来吉他声，打破了寂静，吉他声这么近又那么远，我却觉得愈发寂静。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	只要没课，我便一个人坐在画架前，拿着画笔画落地窗外的风景，从日出到日落，一画就是一天；或者索性搬着椅子坐到阳台，什么都不做，就这么从天亮等到天黑。似乎这个时候的我，一如《鱼》里所唱：“我坐在椅子上，看日出复活。我坐在夕阳里，看城市的衰弱。”\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	那段时间，我不太喜欢和人交流，习惯了离群索居上课坐在角落，下课一个人走。我觉得我甚至笑不出来，迷上了浓茶，爱上了烧酒。我独自走路去Prudential Center，一直呆到很晚的时候，再一个人走回来。那段时间，我觉得身边全是人群，只有心是空荡荡的，似乎一阵风吹来都无处栖息。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	后来，时间一久，一切倒也慢慢被抚平，我重新学会了笑，也重新学会了与朋友相处。回想起之前的那段时光，我笑称它为“被孤单选择的日子”，换句话说，被迫的孤独成长。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	后来去了纽约，我依旧一个人风风火火地找房子，依旧一个人住在上西区的一室一厅，中央公园就在脚下，郁郁葱葱。我喜欢下楼绕着公园跑步，周围多是跑步的人，我们互不干扰，却无形作伴。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	我也喜欢在曼哈顿走路，经常从三十多街往住处走，途径Columbus Circle，然后就是中央公园，有马车经过，有街头艺人，更多的是和我一样行走的New Yorker。偶有迎面走来的人，眼神交流的瞬间，嘴角也礼貌地上扬，一句随口的hi，似乎一切都清楚明了——我们都是同类，在这样的城市孤独地行走着，享受着阳光或者夜晚，热爱自由，独立独行。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/Uploads/2017-03-04/58ba5b221d643.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	如今我依旧一个人行走着，却丝毫不觉得孤单，不知是这座城的魅力，还是现在的自己已然涅槃重生。所以我很感激那段“被孤单选择的日子”，让我经历了一段和自己对话的日子，抽丝剥茧，凤凰涅槃。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	我甚至开始相信，独身久了，会上瘾。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	去MoMa看展，去各种图书馆看书，去有格调的咖啡厅写文案，去陶艺馆做学徒，去学插花茶道，去百老汇听音乐剧，去林肯中心听演奏，每逢周末都给自己买束花儿，玫瑰、百合，或是马蹄莲，整个屋子都明亮起来。把房间布置的很温馨，躺在床上读书，研究菜谱，给自己做精致的一人食——一个人安排自己的生活，可以异常充实，每一寸光阴都为了自己的意愿。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	在纽约我遇见了很多优秀的单身女孩，有些是研究所的学生，有些是金融业的小蜜蜂，有些从事时尚行业，每每提到婚姻，她们多是随缘，眼睛里却满是固执，有个姑娘甚至提高嗓子向我眨眨眼，“You either choose toget a life here or get married, so what would you like to do?” 也许这就是这座城赋予一个人的清高和特立独行。欲望都市里不是说，“也许有些女人注定不该被驾驭，也许她们需要自由奔驰。直到她们找到，性情相投的伴侣一起同行。”\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	随着时光，随着境遇，随着经历，我开始有了切身的体会，就像我说的，不被动的独身者，都是对一个人的生活上了瘾，如若不是真的性情相投，不知如何舍弃一个人的好日子，去成全婚姻。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	我一直在想，这世界上会有人不害怕孤独么。赫尔巴赫说过，\"在所有东西中间，人最需要的还是人。\"人会害怕黑暗，害怕孤独，这是本能，与生俱来的。所以我想，大概没有一个人会真的热爱孤独，或者说，没有一个人希望被隔离，也没有一个人喜欢真正的寂寞。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	可如果独身变成一种生活方式，如果我们还未遇到那个性情相投的同行者，或者命运偏偏和我们开玩笑，让我们遭遇失恋，离婚，甚至更残酷的方式失去爱人。我们也许应该把所有注意力都集中到自己的内心，问问自己，你好吗。看得明白自己，才有资格与他人同行。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	大学心理课上，教授曾经和我们说，一个人一定要在年轻的时候独自生活一段时间，这样才能决定自己想要成为怎样的人，想要和怎样的人一起生活，和自己对话，体察自己内心的需求，选择自己喜欢的生活规律，而不受他人影响。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	没有人会刻意选择独身，只是人生最可怕的就是一个人不知道自己想要什么，婚姻不是避风港，独身者不是孤独者，如果在迷茫的时候，选择先和自己谈场恋爱，理清生活的脉络，再找个心意相通的人一同前行，也算不辜负那段曾经被孤独选择的时光。\r\n</p>','',2,0),(2,'每一声都会好的 每一场颠沛流离','','<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">坐在AMC里看Creed时，我记得我哭满全场，身边的加一自然毫不知情。确实是一部值得踩进影院的电影，从光效到音乐，熟悉的城市背景。只是反反复复想到，如果他不是Creed家族的一员，如果有所选择，他又会走一条怎样的路。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">12/4/2014，我落地纽约，留着收拾到一半的中西部小家，在来到美国的第四年。大多数人听说NYC为我兴奋的时候，我清醒知道我没有选择，换工作换城市是必须，刚扎下的根必须拔去。所以一切都是仓促，打包到一半的家，刚签约一年的房子，刚升职的工作。最重要是，这一次是和家人习惯性掌控我生活的道别，一切联系方式拉黑后，我登上飞往纽约的飞机。</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\"><br />\r\n</span>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"color:#333333;\"><img src=\"/Uploads/2017-03-04/58ba5b56e7417.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\"><br />\r\n</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">我记得第一次在时代广场找到新公司巨大logo时的期待，其实是俗不可耐的霓虹灯箱，红兮兮一溜儿到底，只是在那一刻觉得庆幸，庆幸自己能在做出决定改变现状的瞬间找到新工作转来纽约，未来怎样无从可知，那一刻的幸运却是确凿。回头看相伴左右的A，他对我点点头，紧紧握我的手，说“都会好的”，我笑，点头。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">可惜“都会好的”永远只出现在一切都不那么好的片段。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">新公司新地理新客户新团队新职位，我在一片仓促下接手极度缺人的团队，应付连拼读都成问题的客户，默默感受到团队内部的支离破碎，这一次却有共同的矛盾对象，不出意外是新来的我。连续睡眠不足6周后，开始明显感觉到每天晚餐时的肾疼，举起叉子手却抖到插不进鸡肉块。情人节的晚上，最后留在身边的A也终于转身，我对着不再打得通的电话哭到支离破碎，一遍遍叨念你怎么舍得，我连家人都没了，所有熟悉的环境朋友圈子都放开了，你怎么舍得……电话从未拨通，只是对着一串串忙音，反反复复。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">五月，终于积劳成疾，重度风寒。我不记得自己连续咳了多少个礼拜，一句话破三次才能完成，直到晚上不能平躺休息，每一次呼吸都带着咳音，第一次意识到原来人类睡着以后还是可以被咳嗽呛醒，连续坐了两晚后，终于在第三个晚上坚持不住，在30多度的暖气房间里浑身冰凉冷汗流满整张床，我清晰记得外婆临终前那张淌满冷汗的凉席，于是挣扎起身写下遗言，对不再有联系的家人、对此时回到身边的A有个交代。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">以为都会好起来的时候和A去了New Orleans，已然感觉到二月里的争执留下的无法修复的裂痕，只是依旧期待这个旅行能有所改善，直到又一次争执后双手臂留下血色的抓痕和手印。我记得坐在身边的警察看着远方对我说，男生都很蠢的，说不该说的话做不该做的事伤不该伤的人，然后问我要不要验伤，我摇头。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">我对自己说都会好起来的，然后一边喝到不能从书桌爬回床上，一边逼着自己出门认识各种新人。纽约那么大一个城市，凭什么可以settle down的不是我。从习惯同一个人在身边到把约会当作第二份工作，下了班晕晕乎乎却坚持补妆面带微笑。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">直到遇到S。每一个约会完美到像被计划过无数次，我记得自己慢慢从一次次发呆中被带回现实，记得他笑着问我do you think I’m a player，然后告诉我 you should first have more confidence in yourself and then in me。开始慢慢精打细算生活里的每件东西，重新换上一身身合身的裙装和高跟鞋，我记得一整个夏天堆在脸上的微笑，记得一起踩过的纽约上中下城每一处大大小小的餐厅影院，记得面对S朋友和家人时的紧张。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">公司团队重组，刚熟悉的客户和流程立马没有我的半份，大经理轻轻巧巧对我说这个团队不需要两个领队，新收购的客户没有领队，是个很好的机会，我明白这无非是一个通知，点点头同意滚蛋。果然是个没人愿意接手的新团队，我电话朋友说你知道吗，每天走进房间连英文都可以省略，清一色中国女生被塞进了这个团队，朋友摇头说good luck，我笑，“都会好的”，好像已经是习惯。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">记得S陪伴我一步步做出再次换工作的决定，记得最后一天交回电脑时的失落，记得连回神时间都没有就当晚被公司一纸通知要求偿还所有relocation fee，比当初预期多了整整一万多美金，没有明细，我一次次联系公司联系所有朋友联系可以咨询的律师做好最坏打算，回头才想起早已没有家人的支持。事情告一段落后我一遍遍告诉自己这次真的都会好起来，一声声对所有朋友再三道谢，最后拨通S电话对他说感谢有你。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">12/4/2015，落地纽约一整年，还沉浸在前一晚电影Creed中反反复复，回忆这一整年起伏，没有一件完全是我的选择，却不得不一次次应付下来。直到那天晚上S对着我缓缓说出，I’m really sorry, but we don’t click… 转身才发现应付完一整个世界的混乱以后，身边的人早已走远。我甚至有些惊恐地看着他，不知所措，努力回忆十分钟前究竟发生了什么对话，却只能听见他一遍遍强调this is not negotiable, you can’t change my decision…我记得他似笑非笑一张脸对着我，记得他最后抱完我以后迫切检查衬衣上有否蹭到彩妆，记得自己怎样连滚带爬从他家带出最后的物品，明知自己在那里生活过的所有痕迹都已被抹去——早在那天之前。这次，我说不出“都会好的”，打通朋友电话却连母语都吐不出一个字。我重回影院看Creed，回忆所有的情节，以及，自己的一年。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">而后，继续每天对自己说一声“都会好起来”，哪怕只是习惯，更明确其实没有选择。有多少次看见地铁里马路上那些步履蹒跚的流浪汉，或者是画一脸浓重彩妆伸手问我要一些零钱的老奶奶，打心里担心有一天那个人会是我，只是不再记得发生了什么或者正在发生什么。当生存成为一种状态而生活变成奢侈，其实大多经历都没有选择，一轮轮应付着。我一次次问朋友，也是问自己，如果有选择，谁愿意拥有这样的经历，或者学会这样的坚强。可是没有选择的一年，不也是一年。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">2015年纽约的暖冬，12月间都不曾下雪，holiday season也只留下湿答答的雨水一地，我走在脏兮兮的路上看着迎面走过的路人，猜测他或她的这一年，也许更糟糕更起伏，也许平安顺利，都无从知晓。这里的人，永远快节奏高效率却又忸怩不安，永远冷静现实却又极尽浮夸，永远蠢蠢欲动却又一尘不变。这个城市，永远不缺血脉膨胀的激情，永远不缺匆忙回首间的交错，永远不缺夜幕落下后的泪水。如果睁开眼睛又是一天，那就早点睁开吧。</span> \r\n</p>','',3,0),(3,'围困纽约 Trapped in New York','','<p>\r\n	<span style=\"color:#333333;\">五年前我来到纽约时，身边带来的是一张单程票，两个粗布袋子，没有工作，甚至没有一件冬天的外套——飞机降落的时候，迎接我的是零下15度的气温和死寂的暴风雪。五年后，带着骄傲或无奈的心情，我可以宣布：纽约并没有杀死我，却困住了我——我被牢牢地困在这个天使与魔鬼并存的城市，动弹不得。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">她困住了我的工作，也许我竭尽全力，能够在同行中保持中上的职业水准，但是这里最不缺少的，就是二十三四岁刚从哈佛或者沃顿商学院毕业，径直杀入职场，就能每年赚50万美元的人——他们时刻关注的词汇是“效率”；他们让公司们不再选择相信那些更老的、却不那么聪明的员工的决策；他们大概会在24岁左右拥有公司的股份而现在的我仍要紧盯自己的银行账户余额——看看我能不能付得起去加州参加朋友婚礼的机票。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">她困住了我的爱情，纽约的无数人群，也包括我，长期处于自己会孤独过完余生的忧虑中。我来纽约之前的朋友在此时全都结婚生子而我在纽约的朋友只有20%结了婚，生子的更是少之又少。纽约之外的城市，人们结婚的原因是“你让我变得无比快乐。”而在纽约，这句话变成了“感谢上帝我终于找到了一个可以结婚的人，我们什么时候去领证？”我曾亲眼见到一个同事和我一起工作到深夜，临走时对我说，“我得早点回去了，明天要结婚。”</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">就是如此疯狂的一个城市将我困住，更准确地说，是我“陷入”了纽约。男人健身、女人化妆，大家都试图让自己变得更有吸引力，沿着Broadway走1分钟，你甚至会觉得人人都像个模特——光鲜的外表是必须的，因为这是你的面具，没人会在第一眼就想到你的房间有多脏乱，或者你是不是住在布鲁克林的贫民街区。我陷入了无止境的全方位证明自己的需求中——这里有太多比我长得好看的人，有更多比我有着更好工作的人，我试图在社交网络上展示自己生活的精彩，但很多时候我让自己感到虚伪和愧疚——我尝试着打破这座城市的生存规律，却不断地陷落其中，外在的知觉和身份是这座城市的一切。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"color:#333333;\"><img src=\"/Uploads/2017-03-04/58ba5b7b08d4a.jpg\" alt=\"\" width=\"1080\" height=\"600\" title=\"\" align=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">我被困在这里，但庆幸的是，我没有丢掉我的活力，相反，来纽约之前，我无法想象我能像现在一样工作，充满精力、充满创造力，每天和这个世界上最聪明和最具创造力的人共事，人们成功时的快意会被分享，失败时的沮丧会被共勉。这里大概有你要的全部，这座城市从来不反对什么，一切似乎都是可以被接受和理解的。即使你三十四十，即使是在周一的晚上，你也可以和朋友聚会喝酒直到凌晨，第二天依然精力十足地去上班。她从来不管你的生活，不管你的价值观，不管你的性取向——只要你明天还继续生存在这座水泥森林，即使是在边缘。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">经常有人问我是否爱纽约，我的回答是：我不知道。我只知道当我沿着第五大道向北走，逆着夕阳看到那座103层的帝国大厦时，爱或不爱似乎都并不重要，只是这个场景，已然成为了一次次支撑我和无数人在这座城市走下去的原因：</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">“I can\'t believe I live here. ”</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#333333;\">翻译、编辑/爱尔文</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>','',4,0),(4,'感谢曾经被孤独选择的时光','','<p style=\"white-space:normal;\">\r\n	大学毕业以后，我就再没和别人合租过。那个时候，独自来到波士顿，住在学校附近的high rise，楼有点老旧，一室一厅，价格却不菲。我一个人把装行李的纸箱子一个一个拆开，整理，收纳，布置，花了整整一周的时间。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	那时，我正经历着一场莫名其妙的感情。一个人从波士顿坐巴士去纽约，又一个人坐巴士回来，去的时候，期待有个好的结局，回来的时候，整个心蒙了一层灰。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	记得那时每到晚上，我便蜷缩在沙发里，周围特别静，窗外不远就是山，星空很美，却美得寂寥。有一天夜里，突然传来吉他声，打破了寂静，吉他声这么近又那么远，我却觉得愈发寂静。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	只要没课，我便一个人坐在画架前，拿着画笔画落地窗外的风景，从日出到日落，一画就是一天；或者索性搬着椅子坐到阳台，什么都不做，就这么从天亮等到天黑。似乎这个时候的我，一如《鱼》里所唱：“我坐在椅子上，看日出复活。我坐在夕阳里，看城市的衰弱。”\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	那段时间，我不太喜欢和人交流，习惯了离群索居上课坐在角落，下课一个人走。我觉得我甚至笑不出来，迷上了浓茶，爱上了烧酒。我独自走路去Prudential Center，一直呆到很晚的时候，再一个人走回来。那段时间，我觉得身边全是人群，只有心是空荡荡的，似乎一阵风吹来都无处栖息。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	后来，时间一久，一切倒也慢慢被抚平，我重新学会了笑，也重新学会了与朋友相处。回想起之前的那段时光，我笑称它为“被孤单选择的日子”，换句话说，被迫的孤独成长。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	后来去了纽约，我依旧一个人风风火火地找房子，依旧一个人住在上西区的一室一厅，中央公园就在脚下，郁郁葱葱。我喜欢下楼绕着公园跑步，周围多是跑步的人，我们互不干扰，却无形作伴。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	我也喜欢在曼哈顿走路，经常从三十多街往住处走，途径Columbus Circle，然后就是中央公园，有马车经过，有街头艺人，更多的是和我一样行走的New Yorker。偶有迎面走来的人，眼神交流的瞬间，嘴角也礼貌地上扬，一句随口的hi，似乎一切都清楚明了——我们都是同类，在这样的城市孤独地行走着，享受着阳光或者夜晚，热爱自由，独立独行。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;text-align:center;\">\r\n	<img class=\"lazy lazy-fadein img-responsive\" data-src=\"http://www.ehomie.com/Uploads/2016-12-11/584c53823bfc2.jpg\" src=\"http://www.ehomie.com/Uploads/2016-12-11/584c53823bfc2.jpg\" style=\"display:inline-block;font-family:&quot;text-align:center;white-space:normal;\" />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	如今我依旧一个人行走着，却丝毫不觉得孤单，不知是这座城的魅力，还是现在的自己已然涅槃重生。所以我很感激那段“被孤单选择的日子”，让我经历了一段和自己对话的日子，抽丝剥茧，凤凰涅槃。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	我甚至开始相信，独身久了，会上瘾。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	去MoMa看展，去各种图书馆看书，去有格调的咖啡厅写文案，去陶艺馆做学徒，去学插花茶道，去百老汇听音乐剧，去林肯中心听演奏，每逢周末都给自己买束花儿，玫瑰、百合，或是马蹄莲，整个屋子都明亮起来。把房间布置的很温馨，躺在床上读书，研究菜谱，给自己做精致的一人食——一个人安排自己的生活，可以异常充实，每一寸光阴都为了自己的意愿。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	在纽约我遇见了很多优秀的单身女孩，有些是研究所的学生，有些是金融业的小蜜蜂，有些从事时尚行业，每每提到婚姻，她们多是随缘，眼睛里却满是固执，有个姑娘甚至提高嗓子向我眨眨眼，“You either choose toget a life here or get married, so what would you like to do?” 也许这就是这座城赋予一个人的清高和特立独行。欲望都市里不是说，“也许有些女人注定不该被驾驭，也许她们需要自由奔驰。直到她们找到，性情相投的伴侣一起同行。”\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	随着时光，随着境遇，随着经历，我开始有了切身的体会，就像我说的，不被动的独身者，都是对一个人的生活上了瘾，如若不是真的性情相投，不知如何舍弃一个人的好日子，去成全婚姻。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	我一直在想，这世界上会有人不害怕孤独么。赫尔巴赫说过，\"在所有东西中间，人最需要的还是人。\"人会害怕黑暗，害怕孤独，这是本能，与生俱来的。所以我想，大概没有一个人会真的热爱孤独，或者说，没有一个人希望被隔离，也没有一个人喜欢真正的寂寞。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	可如果独身变成一种生活方式，如果我们还未遇到那个性情相投的同行者，或者命运偏偏和我们开玩笑，让我们遭遇失恋，离婚，甚至更残酷的方式失去爱人。我们也许应该把所有注意力都集中到自己的内心，问问自己，你好吗。看得明白自己，才有资格与他人同行。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	大学心理课上，教授曾经和我们说，一个人一定要在年轻的时候独自生活一段时间，这样才能决定自己想要成为怎样的人，想要和怎样的人一起生活，和自己对话，体察自己内心的需求，选择自己喜欢的生活规律，而不受他人影响。\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	没有人会刻意选择独身，只是人生最可怕的就是一个人不知道自己想要什么，婚姻不是避风港，独身者不是孤独者，如果在迷茫的时候，选择先和自己谈场恋爱，理清生活的脉络，再找个心意相通的人一同前行，也算不辜负那段曾经被孤独选择的时光。\r\n</p>','',2,0),(5,'哥伦比亚大学租房干货','','<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	根据哥伦比亚大学官方报道，学校2015年录取新生30304人，包括8600名本科生、15000名硕士生等，在纽约仅此于纽约大学录取人数。随着2016年秋季学期的到来，哥伦比亚大学学生如何租房?&nbsp;\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	哥伦比亚大学位于曼哈顿岛上西区，包括西116街附近的主校区以及西168街附近的医学院。哥大中国学生住宿热点选择的区域包括: 1. 学校周边 2. 皇后区部分区域 3. 曼哈顿中城 4.新泽西Fort Lee，还有少部分同学会选择住曼哈顿其他区域、Newport等。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	一般来说，住在学校周边主要为了上学方便，可以步行上课下课。而如果选择其他区域，就避免不了要乘坐地铁等公共交通，但每个区域各有特点，每个同学可以根据自己情况进行选择；如果价格预算较高，希望追求繁华和便利，那么曼哈顿中城无疑是第一选择；如果希望租较高性价比，皇后区Elmhurst/Forest Hills等是比较好的选择; 本文将重点介绍哥伦比亚大学主校区附近租房。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">一、哥大附近区域Morningside Heights介绍</i></span>\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/5d1513f0c0342fe5b70e1008cbcfa4cd_b.png\" data-rawwidth=\"990\" data-rawheight=\"635\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"990\" data-original=\"https://pic2.zhimg.com/5d1513f0c0342fe5b70e1008cbcfa4cd_r.png\" data-actualsrc=\"https://pic2.zhimg.com/5d1513f0c0342fe5b70e1008cbcfa4cd_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	上图为中国学生常住的区域，北至125街，南至104街，西到Riverside Dr., 东到Morningside Dr. 和 Columbus Ave.&nbsp;\r\n</p>\r\n<br style=\"box-sizing:inherit;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	1. 区域交通:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	住在该区域内，基本上10分钟内都可步行到学校，不管上课还是自习都非常方便。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	平日在该区域内活动或去其他校区可以依靠校园巴士，周一到周五白天共有三个校园巴士(从96街-主校区-哈林医院-医学院等)，晚上6点到凌晨4点有两个校园巴士(106街-135街)。凭学生ID证免费乘坐。\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/140a9e84d7bee7f65b5057b78235ed0f_b.png\" data-rawwidth=\"454\" data-rawheight=\"612\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"454\" data-original=\"https://pic4.zhimg.com/140a9e84d7bee7f65b5057b78235ed0f_r.png\" data-actualsrc=\"https://pic4.zhimg.com/140a9e84d7bee7f65b5057b78235ed0f_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	在该区域内可在125街/116街/Cathdral Pkwy乘坐1号线至59街即可转乘ABCD, 也可以直接坐到42街时代广场(15分钟)换乘多达数十条地铁线路，很方便去法拉盛、机场等其他区域。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	2. 安全情况:\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/f4b88e31976e0b96b8204de64abde593_b.png\" data-rawwidth=\"849\" data-rawheight=\"534\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"849\" data-original=\"https://pic4.zhimg.com/f4b88e31976e0b96b8204de64abde593_r.png\" data-actualsrc=\"https://pic4.zhimg.com/f4b88e31976e0b96b8204de64abde593_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	纽约市犯罪率地图(哥大附近处于浅色安全系数较高区域，但穿过公园后进入深色区域)\r\n</p>\r\n<img src=\"https://pic1.zhimg.com/29dc5a4e00a8bcad74f290d15bf76f54_b.png\" data-rawwidth=\"490\" data-rawheight=\"282\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"490\" data-original=\"https://pic1.zhimg.com/29dc5a4e00a8bcad74f290d15bf76f54_r.png\" data-actualsrc=\"https://pic1.zhimg.com/29dc5a4e00a8bcad74f290d15bf76f54_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	Trulia 犯罪率地图 (Morningside Heights处于浅色区域，但穿过125街后东北方向哈林区域处于红色和橙色区域)\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	由上面两个图可见，Harlem哈林区安全性较差，Morningside Heights租房区域相对是比较安全的，所以新生刚开始租房时尽量租到上述区域。学校附近街口晚上还会有校警巡逻，附近人员主要是哥大学生，安全性还是挺高的。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	如果晚上自习太晚回家，可以寻求学校Escort Service帮助。Escort服务可以提供从晚7点至凌晨3点，每周7天。涵盖区域包括: 108街至110街, Amsterdam Avenue至Riverside Drive区域; 和111街至122街, Morningside Drive至Riverside Drive。Escort Service由学校受过训练的人员提供，每次2个人，见面时请务必让他们展示哥大学生证确保安全。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	3. 生活便利程度:&nbsp;\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	<img src=\"https://pic1.zhimg.com/22c920974a0d2e5da3cb52b06ddc2eec_b.png\" data-rawwidth=\"736\" data-rawheight=\"423\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"736\" data-original=\"https://pic1.zhimg.com/22c920974a0d2e5da3cb52b06ddc2eec_r.png\" data-actualsrc=\"https://pic1.zhimg.com/22c920974a0d2e5da3cb52b06ddc2eec_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" />哥大附近除了图上显示的Met Food、C-Town等超市之外，还有一些其他适合日常生活购物的超市，能够满足日常生活的购物需要，所以住在学校附近生活还是非常便利的。学校周边也有各式餐馆，如果不在家做饭的同学也可以在外面解决。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	<i style=\"box-sizing:inherit;\"><span style=\"box-sizing:inherit;font-weight:700;\">二、哥大附近租房</span></i>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	首先是学校公寓(UAH), 大部分学校公寓都在Morningside Height主校区附近，但也有部分公寓在Washinton Heights, Manhattan Valley 和Riverdale。学校公寓的官方价格给出的范围是$911-$1537, 均价是$1118。但UAH公寓申请竞争非常激烈，大家一定要尽早申请。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	由于学校公寓提供的数量有限，很多同学申不到UAH的房子，所以大部分同学还需要自己在外面租房。校外租房可以通过找学长学姐转租的房源，也可以找到同学一起在外面整租。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	1. 校外租房户型:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	Studio; 如果希望在校外独立租一套公寓，或者跟男女朋友合住的话，Studio是比较推荐的户型。Studio是开放型公寓，卧室、厨房和浴室连在一起，相比较于1室1厅面积稍小，但价格要便宜20%-30%, 一般$2000-3000/月. 类似格局如下图:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	<img src=\"https://pic2.zhimg.com/f4a7b06ddea0bbccf1b2a24ef31537b1_b.jpg\" data-rawwidth=\"618\" data-rawheight=\"491\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"618\" data-original=\"https://pic2.zhimg.com/f4a7b06ddea0bbccf1b2a24ef31537b1_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/f4a7b06ddea0bbccf1b2a24ef31537b1_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" />2. 多卧室公寓Apartment; 一般指2卧以上，厨房和卫生间等共有，平摊下来$1200-$1700/月/人，一般房间数量越多分摊下来价格就越低。比如哥大附近很火的Coso公寓，有很多学生居住，其中109街2卧1厅1浴 $3000.\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	租房流程:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	哥大附近公寓基本都是由管理公司管理，所有申请都是标准化流程: 1. 通过看房确定房型(需要注意有些房子会有限时送一个月租金优惠); 2. 准备材料(护照和签证), 收入证明、存款证明或担保人信息等，SSN(社会安全号，学生可以不提供)，其他材料(如果学生没有担保人，可以预付8个月-1年租金) 3. 申请和预约 4. 入住，买家具、办理网络等。\r\n</p>','纽约,哥伦比亚大学,租房',1042,0),(6,'Newport租房介绍','','<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	随着2016年秋季录取落下帷幕，很多将要到纽约学习的同学开始为租房而紧急准备着。2016年将有超过15000名新生来到纽约，除此之外还有10倍以上的美国学生、国际学生、工作人群涌入纽约，所以如何租到合适的房子是每个留学生关注的话题。\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	首先我们来介绍Newport租房，Newport由于其相比较于曼哈顿较高的性价比、优美的环境、优越的位置而颇受学生欢迎。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1. Newport交通\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1.1 Path Train\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/e021f2354ff66784e9d0601a57016c2e_b.jpg\" data-rawwidth=\"446\" data-rawheight=\"332\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"446\" data-original=\"https://pic3.zhimg.com/e021f2354ff66784e9d0601a57016c2e_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/e021f2354ff66784e9d0601a57016c2e_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\"><img src=\"https://pic1.zhimg.com/637e53d4daeb85fbee08a78d4359f42c_b.png\" data-rawwidth=\"454\" data-rawheight=\"236\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"454\" data-original=\"https://pic1.zhimg.com/637e53d4daeb85fbee08a78d4359f42c_r.png\" data-actualsrc=\"https://pic1.zhimg.com/637e53d4daeb85fbee08a78d4359f42c_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	住在Newport的同学或上班人群大部分乘坐Path Train来返曼哈顿，其中经过Newport有两个方向，一个方向经过Christopher St, 9th St (纽约大学), 14th St, 23rd St, 达到曼哈顿中城33rd St (周一至周五晚11点后，和周末会经过Hoboken), 该线路是大部分学生出行的主要路线。从Newport至9th St (纽约大学)需14分钟，33街需18分钟；\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Path Train另一条线路通向世贸中心, 时间为7分钟。该线路是在金融区上班的同学最佳选择，比住在曼哈顿很多地方都要方便。\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/c8e4e6286351173d091af3ba0f7e35e6_b.jpg\" data-rawwidth=\"1272\" data-rawheight=\"721\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1272\" data-original=\"https://pic3.zhimg.com/c8e4e6286351173d091af3ba0f7e35e6_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/c8e4e6286351173d091af3ba0f7e35e6_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	到达33街Path站后，可转地铁B/D/F/M/N/Q/R等，很方便到法拉盛、JFK/LGA机场、中国城等其他区域。Path Train月票价格是$89/月。\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1.2 Waterway 轮渡:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Path Train由于其便利、便宜的特点，所以很少有同学会将水上轮渡作为主要交通工具，大家感兴趣可以花上6美元体验下哈德逊河和曼哈顿的美景。<img src=\"https://pic4.zhimg.com/d16ad172c3e49def6d8e536ae4a4867b_b.jpg\" data-rawwidth=\"728\" data-rawheight=\"485\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"728\" data-original=\"https://pic4.zhimg.com/d16ad172c3e49def6d8e536ae4a4867b_r.jpg\" data-actualsrc=\"https://pic4.zhimg.com/d16ad172c3e49def6d8e536ae4a4867b_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" /> \r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1.3 自行驾车:\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Newport位于Holland隧道入口处，通过隧道即可到达曼哈顿。但曼哈顿平时非常拥堵，如果不是特别情况一般不建议开车前往。每次经过隧道需$15。\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2. Newport环境\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2.1 安全系数:\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	对大部分同学来说，安全性是租房考虑的最重要因素。根据Trulia统计犯罪率地图，绿色表示安全区域，大家可以看到Newport是比较安全的区域。\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/18bf69cddf3efcb478d6c7472e2365e6_b.png\" data-rawwidth=\"600\" data-rawheight=\"336\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"600\" data-original=\"https://pic3.zhimg.com/18bf69cddf3efcb478d6c7472e2365e6_r.png\" data-actualsrc=\"https://pic3.zhimg.com/18bf69cddf3efcb478d6c7472e2365e6_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\"><br style=\"box-sizing:inherit;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2.2 生活环境:\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Newport生活非常便利，满足日常需求无任何问题，其中在步行10分钟左右的路程可以到达:\r\n</p>\r\n<ul style=\"box-sizing:inherit;margin:20px 0px;padding:0px 0px 0px 24px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<li style=\"box-sizing:inherit;list-style-type:initial;margin-top:10px;list-style-position:outside;\">\r\n	<em style=\"box-sizing:inherit;\"><strong style=\"box-sizing:inherit;\">超市</strong></em> \r\n</li>\r\n	</ul>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1. Morton Williams (Newport社区里超市，包括各类食品和生活用品)\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2. Shoprite美国大型超市\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	3. Target美国大型超市\r\n		</p>\r\n<ul style=\"box-sizing:inherit;margin:20px 0px;padding:0px 0px 0px 24px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n		<li style=\"box-sizing:inherit;list-style-type:initial;margin-top:10px;list-style-position:outside;\">\r\n			<em style=\"box-sizing:inherit;\"><strong style=\"box-sizing:inherit;\">购物</strong></em><br style=\"box-sizing:inherit;\" />\r\n		</li>\r\n			</ul>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1. Newport中心购物广场\r\n				</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	包括Macy\'s(梅西百货，包括各大品牌), Sears(也是百货超市), JCPenny(还是百货超市)，Coach, Adidas, H&amp;M等\r\n			</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2. Bed Bath &amp; Beyond 床上用品、家居产品及居家必备用品\r\n				</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	3. CVS、Duane Reade 药店，可以买到各类药品和日常用品\r\n			</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	4. Bestbuy 百思买 可以买到各类电器\r\n				</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	5. Home Depot 美国最大的家庭装饰和建材超市，可以买到一些常用家具和家庭用品\r\n			</p>\r\n<ul style=\"box-sizing:inherit;margin:20px 0px;padding:0px 0px 0px 24px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n			<li style=\"box-sizing:inherit;list-style-type:initial;margin-top:10px;list-style-position:outside;\">\r\n				<strong style=\"box-sizing:inherit;\"><em style=\"box-sizing:inherit;\">其他</em></strong><br style=\"box-sizing:inherit;\" />\r\n			</li>\r\n		</ul>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	1. 银行 包括Chase、Bank of America、TD Bank等\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	2. 电话、网络 包括Verizon、ATT、Sprint等公司，方便同学办理电话网络等业务\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	3. 邮局 UPS邮局，可以寄国际邮递\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	3. Newport 租房\r\n		</p>\r\n<img src=\"https://pic3.zhimg.com/9112f142466bef7691e98bc3003b006e_b.jpg\" data-rawwidth=\"750\" data-rawheight=\"502\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"750\" data-original=\"https://pic3.zhimg.com/9112f142466bef7691e98bc3003b006e_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/9112f142466bef7691e98bc3003b006e_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	综上大家可以知道Newport交通和环境非常好，那么租房成本怎么样呢？根据小e统计，按照同种户型房租中位数计算，Newport租金比同等曼哈顿公寓价格要低30%-50%。2016年最新房源价格如下，大家可以参考:\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Studio(适合1-2人居住): $1850-$2250, 面积: 40-60平方米左右\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	一室一厅(客厅一般可以隔断): $2300-$2900，面积: 60-80平方米左右\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	二室一厅: $2600-$4000，面积: 100-120平方米左右\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	三室一厅: $3800以上, 面积 120平方米以上\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	所以如果大家能够找到室友一起租的话，并通过隔断客厅分担房租，每个人预算大约需要$1000-$1500不等。而同等价位的曼哈顿公寓条件和面积大小就要差很多了。\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Newport区域大概有15栋公寓楼可供选择，包括Newport公司: Aquablu、Atlantic、East Hampton、Pacific、South Hampton等, 以及包括Avalon Cove、Monaco、Marbella。根据同学预算和要求的差异，可以选择不同的公寓。\r\n	</p>\r\n<img src=\"https://pic3.zhimg.com/a4ab2bac93bedff93f0ba033d09eceda_b.jpg\" data-rawwidth=\"787\" data-rawheight=\"509\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"787\" data-original=\"https://pic3.zhimg.com/a4ab2bac93bedff93f0ba033d09eceda_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/a4ab2bac93bedff93f0ba033d09eceda_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	租房流程\r\n		</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	Newport附近公寓都是由管理公司管理，所有申请都是标准化流程: 1. 通过看房确定房型(需要注意有些房子会有限时送一个月租金优惠); 2. 准备材料(护照和签证), 收入证明、存款证明或担保人信息等，SSN(社会安全号，学生可以不提供)，其他材料(如果学生没有担保人，可以预付6个月租金) 3. 申请和预约 4. 入住，买家具、办理网络等。\r\n	</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \" font-size:medium;white-space:normal;\"=\"\">\r\n	希望这篇文章能帮大家更好的了解Newport!\r\n		</p>','newport,租房',1043,0),(7,'罗岛租房攻略','','                <span style=\"font-family:-apple-system, \"font-size:medium;white-space:normal;\">罗斯福岛 Roosevelt Island，简称罗岛，是一个坐落于纽约市东河上的狭长岛屿，介于曼哈顿东侧与皇后区西侧之间。岛的长度约为3000米，范围约等于从曼哈顿东46街至东85街之间，从最南端步行至最北端约30分钟。岛上的最大宽度仅有240米，居住人口约为1万人。</span>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<img src=\"https://pic1.zhimg.com/1e4878a539e16cbc6e81c08871e89c70_b.jpg\" data-rawwidth=\"1266\" data-rawheight=\"703\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1266\" data-original=\"https://pic1.zhimg.com/1e4878a539e16cbc6e81c08871e89c70_r.jpg\" data-actualsrc=\"https://pic1.zhimg.com/1e4878a539e16cbc6e81c08871e89c70_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" /><br style=\"box-sizing:inherit;\" />\r\n大多数罗岛住宅建筑为出租公寓，相对于曼哈顿公寓来说，性价比要更高，且罗岛环境非常优美，因此受到很多中国留学生的欢迎。本文将全面介绍罗岛租房。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	--------------------------------------------1. 罗岛区域介绍-------------------------------------------\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/c62702497a444fc147cab95c4c39d225_b.jpg\" data-rawwidth=\"720\" data-rawheight=\"400\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"720\" data-original=\"https://pic2.zhimg.com/c62702497a444fc147cab95c4c39d225_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/c62702497a444fc147cab95c4c39d225_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">区域交通:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<br style=\"box-sizing:inherit;\" />\r\n<img src=\"https://pic4.zhimg.com/985aa60051e04bd60085e2e7a1c0d7e3_b.png\" data-rawwidth=\"585\" data-rawheight=\"317\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"585\" data-original=\"https://pic4.zhimg.com/985aa60051e04bd60085e2e7a1c0d7e3_r.png\" data-actualsrc=\"https://pic4.zhimg.com/985aa60051e04bd60085e2e7a1c0d7e3_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" />罗斯福岛出行主要有三种方式: 地铁(Subway), 缆车(Tram), 公交车(Bus)。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	地铁\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛有地铁F线经过，乘坐F线可直接到纽约大学(约20分钟)，或转1号线至哥伦比亚大学(约40分钟)。该地铁车站位于深达地下30米处，是纽约市最深的地铁站之一。\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/6cc6339cb04b5cf513ac05d37287948b_b.jpg\" data-rawwidth=\"650\" data-rawheight=\"361\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"650\" data-original=\"https://pic4.zhimg.com/6cc6339cb04b5cf513ac05d37287948b_r.jpg\" data-actualsrc=\"https://pic4.zhimg.com/6cc6339cb04b5cf513ac05d37287948b_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	缆车\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	除了地铁外，缆车是最方便的交通方式，缆车运行时间从早上5:45到凌晨2:45，一周7天。早上7:00-10:00，下午3:00-8:00为高峰期间每7、8分钟一班，其他时间15分钟一班。可从罗斯福岛直接乘坐到曼哈顿2大道59街，步行两个ave可至Lexington Ave59街地铁N/Q/R线。缆车乘坐价格和地铁一样，可以直接使用纽约地铁卡。\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/141901f77871ab78ba881ad41c405c5d_b.jpg\" data-rawwidth=\"1140\" data-rawheight=\"633\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1140\" data-original=\"https://pic2.zhimg.com/141901f77871ab78ba881ad41c405c5d_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/141901f77871ab78ba881ad41c405c5d_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	汽车\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛有免费红色巴士往返于公寓和地铁站、缆车站，高峰期间每7、8分钟一班，其他时间15分钟一班。大家可以用app查red bus时间再下楼乘车，但岛不大，即使错过了步行至地铁站也仅10分钟。\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/cdd5ac21e3bdd51753579953a642d611_b.jpg\" data-rawwidth=\"752\" data-rawheight=\"149\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"752\" data-original=\"https://pic2.zhimg.com/cdd5ac21e3bdd51753579953a642d611_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/cdd5ac21e3bdd51753579953a642d611_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	另外，罗岛有MTA 巴士Q102可往返于皇后区Astoria.\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/d70c797b3d1005ed7b4b7932bc378f79_b.jpg\" data-rawwidth=\"1020\" data-rawheight=\"567\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1020\" data-original=\"https://pic2.zhimg.com/d70c797b3d1005ed7b4b7932bc378f79_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/d70c797b3d1005ed7b4b7932bc378f79_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">安全情况:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<img src=\"https://pic4.zhimg.com/1a0af12d75fce8f990955e82e2eb1c5b_b.png\" data-rawwidth=\"812\" data-rawheight=\"517\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"812\" data-original=\"https://pic4.zhimg.com/1a0af12d75fce8f990955e82e2eb1c5b_r.png\" data-actualsrc=\"https://pic4.zhimg.com/1a0af12d75fce8f990955e82e2eb1c5b_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;\" />上图为纽约每千人犯罪比率，罗岛是纽约市犯罪率最低的区域。整个罗岛居住人口以学生、中等收入以上工作人士等为主，安全性是非常高的。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">生活环境:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛的生活环境非常优美，天气不错的时候可以在河边吹吹风，坐在草地上晒晒太阳，或者跑跑步。\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/0e93343297012490391dc092d9fc9402_b.jpg\" data-rawwidth=\"1618\" data-rawheight=\"898\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1618\" data-original=\"https://pic3.zhimg.com/0e93343297012490391dc092d9fc9402_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/0e93343297012490391dc092d9fc9402_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛的北部有一个公园--Lighthouse Park，里面有灯塔以及可以烧烤的地方。\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/b90ed39c14a407e7d8d7414819a387a9_b.jpg\" data-rawwidth=\"1600\" data-rawheight=\"888\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1600\" data-original=\"https://pic2.zhimg.com/b90ed39c14a407e7d8d7414819a387a9_r.jpg\" data-actualsrc=\"https://pic2.zhimg.com/b90ed39c14a407e7d8d7414819a387a9_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛的南部有两个公园--Southpoint Park以及FDR Four Freedoms Park. FDR公园景色非常优美，能够看到长岛市、联合国等。\r\n</p>\r\n<img src=\"https://pic1.zhimg.com/700c3c6ac2d70a4f1cac067eb0b9fe38_b.jpg\" data-rawwidth=\"1471\" data-rawheight=\"544\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1471\" data-original=\"https://pic1.zhimg.com/700c3c6ac2d70a4f1cac067eb0b9fe38_r.jpg\" data-actualsrc=\"https://pic1.zhimg.com/700c3c6ac2d70a4f1cac067eb0b9fe38_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">生活便利:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗斯福岛有一些商店和餐厅，主要集中在Main St上，包括星巴克等基本能满足日常需要，但选择还是相对较少。很多同学选择去曼岛的中国城或其他超市买东西，也可以去皇后区。\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/eddc8f09b245deee6bdc4c357fe235fe_b.jpg\" data-rawwidth=\"571\" data-rawheight=\"226\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"571\" data-original=\"https://pic3.zhimg.com/eddc8f09b245deee6bdc4c357fe235fe_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/eddc8f09b245deee6bdc4c357fe235fe_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	--------------------------------------------2. 罗岛租房介绍-------------------------------------------\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	罗岛比较受中国学生欢迎的公寓有: Manhattan Park (4栋), The Octagon, Riverwalk，Eastwood (6栋). 价格由低到高为: Eastwood, Manhattan Park, The Octagon, Riverwalk.\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	Eastwood:\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/5820ae771c7ff89bdbd10fd86a40b392_b.jpg\" data-rawwidth=\"650\" data-rawheight=\"365\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"650\" data-original=\"https://pic3.zhimg.com/5820ae771c7ff89bdbd10fd86a40b392_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/5820ae771c7ff89bdbd10fd86a40b392_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	Manhattan Park:\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/2ed06d771311350fbc9f85b7d7deb713_b.jpg\" data-rawwidth=\"1260\" data-rawheight=\"700\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1260\" data-original=\"https://pic4.zhimg.com/2ed06d771311350fbc9f85b7d7deb713_r.jpg\" data-actualsrc=\"https://pic4.zhimg.com/2ed06d771311350fbc9f85b7d7deb713_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	The Octagon:\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/a80316c31d39d969fffe639d9dbbaa36_b.jpg\" data-rawwidth=\"1200\" data-rawheight=\"600\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"1200\" data-original=\"https://pic3.zhimg.com/a80316c31d39d969fffe639d9dbbaa36_r.jpg\" data-actualsrc=\"https://pic3.zhimg.com/a80316c31d39d969fffe639d9dbbaa36_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	Riverwalk Crossing:\r\n</p>\r\n<img src=\"https://pic1.zhimg.com/3f95abf547bb5e90154b52d0517cb650_b.jpg\" data-rawwidth=\"540\" data-rawheight=\"300\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"540\" data-original=\"https://pic1.zhimg.com/3f95abf547bb5e90154b52d0517cb650_r.jpg\" data-actualsrc=\"https://pic1.zhimg.com/3f95abf547bb5e90154b52d0517cb650_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">租房户型:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	1. Studio; 如果希望独立租一套公寓，Studio是比较推荐的户型。Studio是开放型公寓，卧室、厨房和浴室连在一起，相比较于1室1厅面积稍小，但价格要便宜, 罗岛价格一般$2300-3000/月. 该部分房源罗岛供应比较有限，希望大家可以提前做好准备。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	2. 多卧室公寓Apartment; 一般指2卧或以上，厨房和卫生间等共有，根据公寓的条件不同平摊下来$1300-$2000/月/人，一般房间数量越多分摊下来价格就越低。参考户型如下:\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/bfd8fe494cf7cef0340ddc2e0b49fdaf_b.jpg\" data-rawwidth=\"582\" data-rawheight=\"380\" class=\"origin_image zh-lightbox-thumb lazy\" width=\"582\" data-original=\"https://pic4.zhimg.com/bfd8fe494cf7cef0340ddc2e0b49fdaf_r.jpg\" data-actualsrc=\"https://pic4.zhimg.com/bfd8fe494cf7cef0340ddc2e0b49fdaf_b.jpg\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, \"font-size:medium;white-space:normal;\" /><br style=\"box-sizing:inherit;font-family:-apple-system, \"font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	<span style=\"box-sizing:inherit;font-weight:700;\"><i style=\"box-sizing:inherit;\">租房流程:</i></span>\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, \"font-size:medium;white-space:normal;\">\r\n	如果需要整租罗岛公寓，所有申请都是标准化流程: 1. 通过看房确定房型(需要注意有些房子会有限时送一个月租金优惠); 2. 准备材料(护照和签证), 收入证明、存款证明或担保人信息等，SSN(社会安全号，学生可以不提供)，其他材料(如果学生没有担保人，可以预付8个月-1年租金) 3. 申请和预约 4. 入住，买家具、办理网络等。\r\n</p>            ','',1044,0),(9,'为什么需要e乡e家——您与众不同的纽约专业租房管家','','<style type=\"text/css\">\r\np.p1 {margin: 0.0px 0.0px 0.0px 0.0px; font: 14.0px \'Helvetica Neue\'; color: #323333; -webkit-text-stroke: #323333}\r\np.p2 {margin: 0.0px 0.0px 0.0px 75.5px; text-indent: -75.6px; font: 14.0px \'Helvetica Neue\'; color: #323333; -webkit-text-stroke: #323333}\r\np.p3 {margin: 0.0px 0.0px 0.0px 24.0px; text-indent: -24.0px; font: 14.0px \'Helvetica Neue\'; color: #323333; -webkit-text-stroke: #323333}\r\np.p4 {margin: 0.0px 0.0px 0.0px 72.0px; text-indent: -72.0px; font: 14.0px \'Helvetica Neue\'; color: #323333; -webkit-text-stroke: #323333}\r\nspan.s1 {font-kerning: none}\r\n</style>\r\n<p class=\"p1\">\r\n	<span class=\"s1\"><b> </b></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;display:inline !important;\">\r\n	<b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;为什么需要<span>e</span></b><b>乡<span>e</span></b><b>家？</b> \r\n</p>\r\n<p class=\"p1\">\r\n	<span class=\"s1\"><b style=\"-webkit-text-stroke-width:initial;\"></b><b> </b></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n	<b><b><span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ——</span></b><b>您与众不同的纽约专业租房管家<span></span></b> </b>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span>1.</span><b>规范性</b>：<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:2.0cm;text-indent:-35.4pt;\">\r\n	<b><span>（1） </span>留学生，怕被坑。不能实地看房，不了解租赁公司或房东的基本信息。<span>e</span>乡<span>e</span>家前期有人实地看房，与租赁公司进行交涉，房价透明，性价比高，价格实诚。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:2.0cm;text-indent:-35.4pt;\">\r\n	<b><span>（2） </span><span>e</span>乡<span>e</span>家承诺，不向客户收取任何中介费。且可以帮助客户免除自身找本地中介所产生的高昂中介费。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<b><span>2. </span><b>标准性</b>：<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<b>主打公寓租房，直接链接到几大地盘的各大公寓，覆盖主要留学生校区，生活区。不与私人房东，<span>house</span>等不标准，不安全，有欺诈性的房源产生联系。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<b><span>3. </span><b>便捷性</b>：<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<b>上万套公寓的房源供应，让你轻松选中自己喜欢的。从选房位置，到公寓配置，室友配对，只需一键。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<b><span>4. </span><b>体验性</b>：<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:54.0pt;text-indent:-36.0pt;\">\r\n	<b><span>（1） </span>网站设置简洁大方，浏览起来赏心悦目。输入自己的用户诉求，可产生相应匹配。其他论坛网站体验观感无法匹敌。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:54.0pt;text-indent:-36.0pt;\">\r\n	<b><span>（2） </span>设有<span>VR</span>看房，实景看房，地图找房，关键词搜房。让租房身临其境。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:54.0pt;text-indent:-36.0pt;\">\r\n	<b><span>（3） </span>专栏文章可供读者阅览，包括留学生的租房故事，各地带租房攻略。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:54.0pt;text-indent:-36.0pt;\">\r\n	<b><span>（4） </span>后台沟通便利，纽约北京均设立办公室，纽约处办公人员皆有留学背景，有经验可供参考，实现顺畅沟通。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<b><span>5. </span><b>连贯性</b>：<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:0cm;\">\r\n	<b>除开租房等系列手续，入住期间的家具，留学生初到的接机服务，订机票参考服务，电话卡网卡办理等一条龙服务。一旦沟通合适，均可定制实现。<span></span> </b>\r\n</p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;text-indent:-18.0pt;\">\r\n	<b><span>6. </span><span>e</span>乡<span>e</span>家作为服务型网站，致力给中国留学生营造良好舒适的租房环境，免去不必要的困扰，为留学生以后的学习生活铺路。期待您的信任。<span></span> </b>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"p1\">\r\n	<br />\r\n</p>','纽约租房,e乡e家',1046,0),(8,'曼哈顿豪华出租公寓详细介绍','','<span style=\"font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">最全的留学生可以租住的曼哈顿豪华出租公寓详解。曼哈顿有哪些豪华出租公寓呢，又“壕”在哪里呢？</span>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	【<strong style=\"box-sizing:inherit;\">曼哈顿中城</strong>】\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	1. Sky\r\n</p>\r\n<img src=\"https://pic1.zhimg.com/4628aee6989433efceec2b24c78e5be4_b.png\" data-rawwidth=\"201\" data-rawheight=\"356\" width=\"201\" class=\"content_image lazy\" data-actualsrc=\"https://pic1.zhimg.com/4628aee6989433efceec2b24c78e5be4_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic4.zhimg.com/1a07a5826117995ce2a93838e2d31c13_b.png\" data-rawwidth=\"643\" data-rawheight=\"355\" width=\"643\" data-original=\"https://pic4.zhimg.com/1a07a5826117995ce2a93838e2d31c13_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic4.zhimg.com/1a07a5826117995ce2a93838e2d31c13_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：605 West 42th St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: 该楼新建于2015年，共71层。楼内设施先进齐全，包括<strong style=\"box-sizing:inherit;\">NBA标准篮球场</strong>、室内室外<strong style=\"box-sizing:inherit;\">两个游泳池</strong>、各类运动俱乐部等，洗浴桑拿各类高级设施应有尽有！非常适合喜欢运动和追求生活品质的学生。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $2912/月，1室公寓 $4505/月，2室公寓 $6715/月起；\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	2. VIA\r\n</p>\r\n<img src=\"https://pic2.zhimg.com/0d4b03855653051e80c011ead2cb1c61_b.png\" data-rawwidth=\"641\" data-rawheight=\"357\" width=\"641\" data-original=\"https://pic2.zhimg.com/0d4b03855653051e80c011ead2cb1c61_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic2.zhimg.com/0d4b03855653051e80c011ead2cb1c61_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic3.zhimg.com/e76f0edce2a9996bd6f87647673ef2da_b.png\" data-rawwidth=\"604\" data-rawheight=\"334\" width=\"604\" data-original=\"https://pic3.zhimg.com/e76f0edce2a9996bd6f87647673ef2da_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic3.zhimg.com/e76f0edce2a9996bd6f87647673ef2da_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：625 West 57th St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: 该楼刚建于2016年，共32层。楼由世界著名设计师Bjarke Ingel设计，非常有特色。内部设施齐全，包括游泳池、健身房、<strong style=\"box-sizing:inherit;\">室内篮球场、高尔夫练习室</strong>等\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $3000/月，1室公寓 $3800/月，2室公寓 $8000/月起；\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	3. MIMA\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/a76efef2a481186efc73bd53ae5d2153_b.png\" data-rawwidth=\"638\" data-rawheight=\"354\" width=\"638\" data-original=\"https://pic4.zhimg.com/a76efef2a481186efc73bd53ae5d2153_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic4.zhimg.com/a76efef2a481186efc73bd53ae5d2153_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic2.zhimg.com/f9387f9ec343da66cb03a7e66f91fad9_b.png\" data-rawwidth=\"639\" data-rawheight=\"355\" width=\"639\" data-original=\"https://pic2.zhimg.com/f9387f9ec343da66cb03a7e66f91fad9_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic2.zhimg.com/f9387f9ec343da66cb03a7e66f91fad9_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：450 West 42th St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: MIMA地处曼哈顿黄金地带，步行5分钟即可达到时代广场。MIMA共有53层，站在MIMA大厦上，能够观赏到纽约的全景，俯瞰Hudson River和中央公园。MIMA内部各类设施齐全，除了健身房、游泳池外还有<strong style=\"box-sizing:inherit;\">标准尺寸的篮球场和排球场</strong>，是喜欢打篮球的高富帅首选公寓！\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $3645/月, 1室公寓 $4270/月，2室公寓 $6300/月起\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	4. Emerald Green\r\n</p>\r\n<img src=\"https://pic4.zhimg.com/f13368f5f14b89203eb3400f1ba850c3_b.png\" data-rawwidth=\"639\" data-rawheight=\"353\" width=\"639\" data-original=\"https://pic4.zhimg.com/f13368f5f14b89203eb3400f1ba850c3_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic4.zhimg.com/f13368f5f14b89203eb3400f1ba850c3_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic1.zhimg.com/5e503a60352a8457ea563f9589d0a13c_b.png\" data-rawwidth=\"639\" data-rawheight=\"358\" width=\"639\" data-original=\"https://pic1.zhimg.com/5e503a60352a8457ea563f9589d0a13c_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic1.zhimg.com/5e503a60352a8457ea563f9589d0a13c_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：310 West 38th St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: Emerald Green建于2010年，共24层两栋连体公寓。公寓设施豪华，包括游泳池、桑拿房、健身房。位置非常便利，步行几个街道即到时代广场、宾州火车站、NYU 中城校区、各地铁站等。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $3495/月, 1室公寓 $4095/月，2室公寓 $6190/月\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	5. Silver Towers\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/e125d147fda97af21777730068db029e_b.png\" data-rawwidth=\"498\" data-rawheight=\"274\" width=\"498\" data-original=\"https://pic3.zhimg.com/e125d147fda97af21777730068db029e_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic3.zhimg.com/e125d147fda97af21777730068db029e_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic3.zhimg.com/9c82c788385d91c25a5178bf7c3366f6_b.png\" data-rawwidth=\"636\" data-rawheight=\"352\" width=\"636\" data-original=\"https://pic3.zhimg.com/9c82c788385d91c25a5178bf7c3366f6_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic3.zhimg.com/9c82c788385d91c25a5178bf7c3366f6_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：600 West 42nd St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: Silver Towers是位于曼哈顿中城的一座双子塔建筑住宅楼。该座60层的建筑建于2009年，位于第十一大道西侧，介于41、42街之间，靠近Hudson River。该楼包括一个长75英尺的游泳池，是纽约市最大的住宅楼，楼西侧有一个0.25英亩公共公园。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $3390/月, 1室公寓 $3990/月，2室公寓 $6190/月起\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	6. The Continental\r\n</p>\r\n<img src=\"https://pic3.zhimg.com/986d2d73352a94cd66da2def89765902_b.png\" data-rawwidth=\"635\" data-rawheight=\"350\" width=\"635\" data-original=\"https://pic3.zhimg.com/986d2d73352a94cd66da2def89765902_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic3.zhimg.com/986d2d73352a94cd66da2def89765902_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic2.zhimg.com/f6a3115defde5d87945770115bc18cd1_b.png\" data-rawwidth=\"562\" data-rawheight=\"312\" width=\"562\" data-original=\"https://pic2.zhimg.com/f6a3115defde5d87945770115bc18cd1_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic2.zhimg.com/f6a3115defde5d87945770115bc18cd1_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：885 Ave of 