b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" /><img src=\"https://pic4.zhimg.com/13e432c0e2cd14fdfea967e02b2fa05b_b.png\" data-rawwidth=\"639\" data-rawheight=\"348\" width=\"639\" data-original=\"https://pic4.zhimg.com/13e432c0e2cd14fdfea967e02b2fa05b_r.png\" class=\"origin_image zh-lightbox-thumb lazy\" data-actualsrc=\"https://pic4.zhimg.com/13e432c0e2cd14fdfea967e02b2fa05b_b.png\" style=\"box-sizing:inherit;overflow:hidden;display:block;max-width:100%;margin:0.72em auto;cursor:-webkit-zoom-in;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\" />\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	地址：200 West 72nd St\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	简介: 该楼位于林肯中心，建于2008年，共24层。步行五分钟即至<strong style=\"box-sizing:inherit;\">Fordham校园</strong>。该楼靠近中央公园，非常适合喜欢跑步的同学。\r\n</p>\r\n<p style=\"box-sizing:inherit;margin-top:20px;margin-bottom:20px;font-family:-apple-system, &quot;font-size:medium;white-space:normal;\">\r\n	价位：Studio $3600/月，1室公寓 $5400/月，2室公寓 $9500/月起\r\n</p>','曼哈顿,豪华公寓',1045,0);
