DROP TABLE IF EXISTS `oc_rent_consult`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `oc_rent_consult` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `uid` int(11) DEFAULT NULL COMMENT '用户UID',
  `name` varchar(127) NOT NULL DEFAULT '' COMMENT '姓名',
  `area_code` varchar(10) NOT NULL DEFAULT '' COMMENT '区号',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '电话',
  `rent_date` int(11) unsigned DEFAULT '0' COMMENT '预计入住时间',
  `rid` int(11) NOT NULL COMMENT '房源ID',
  `number` varchar(127) NOT NULL DEFAULT '' COMMENT '公寓号码',
  `email` varchar(63) NOT NULL DEFAULT '' COMMENT '邮箱',
  `wechat` varchar(63) NOT NULL DEFAULT '' COMMENT '微信',
  `code` varchar(20) NOT NULL DEFAULT '' COMMENT '优惠推荐码',
  `comment` varchar(255) NOT NULL DEFAULT '' COMMENT '其他信息',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=105 DEFAULT CHARSET=utf8 COMMENT='立即咨询信息表';
